-- ----------------------------
-- Function structure for MD5
-- ----------------------------
CREATE FUNCTION "MD5"(in_str IN VARCHAR2)
RETURN VARCHAR2
IS
retval varchar2(32);
BEGIN
retval := utl_raw.cast_to_raw(DBMS_OBFUSCATION_TOOLKIT.MD5(INPUT_STRING => in_str));
--dbms_output.put_line('<'||in_str||'>的MD5:'||retval);
RETURN retval;
END;
